const Layout = (Page) => {
    return () => (
        <div className="content">
            <Page />
            <style global jsx>{`
                html {
                    height: 100%;
                }

                .content {
                    display: flex;
                    flex: 1 1 100%;
                    height: 100%;
                    justify-content: center;
                    align-items: center;
                    margin: 0;
                }
            `}</style>
        </div>
    )
}

export default Layout
